DO
$do$
    BEGIN
        IF NOT EXISTS(
                SELECT
                FROM pg_catalog.pg_roles
                WHERE rolname = 'airuser') THEN
            CREATE ROLE airuser LOGIN PASSWORD 'airuser';
        END IF;
    END;
    $do$;

SELECT 'CREATE DATABASE airport'
WHERE NOT EXISTS(SELECT FROM pg_database WHERE datname = 'airport')
\gexec

create extension postgis;

GRANT ALL PRIVILEGES ON DATABASE airport TO airuser;

DROP TABLE IF EXISTS "aircrews";
CREATE TABLE "public"."aircrews"
(
    "id" uuid NOT NULL,
    CONSTRAINT "aircrews_pkey" PRIMARY KEY ("id")
) WITH (oids = false);

DROP TABLE IF EXISTS "airplanes";
CREATE TABLE "public"."airplanes"
(
    "id"      uuid NOT NULL,
    "columns" integer,
    "model"   character varying(255),
    "rows"    integer,
    "storeys" integer,
    "type"    character varying(255),
    CONSTRAINT "airplanes_pkey" PRIMARY KEY ("id")
) WITH (oids = false);

DROP TABLE IF EXISTS "airports";
CREATE TABLE "public"."airports"
(
    "id"         uuid                   NOT NULL,
    "iata_code"  character varying(4)   NOT NULL,
    "icao_code"  character varying(4),
    "coordinate" geography(POINT)       NOT NULL,
    "name"       character varying(255) NOT NULL,
    "city_id"    integer                NOT NULL,
    CONSTRAINT "airports_pkey" PRIMARY KEY ("id"),
    CONSTRAINT "uk_rck10qn096aw10ds8rjqf35ah" UNIQUE ("iata_code")
) WITH (oids = false);
CREATE INDEX "airports_points_index" ON "public"."airports" USING GIST ("coordinate");


DROP TABLE IF EXISTS "cities";
DROP SEQUENCE IF EXISTS cities_id_seq;
CREATE SEQUENCE cities_id_seq INCREMENT 1 MINVALUE 1 MAXVALUE 2147483647 CACHE 1;

CREATE TABLE "public"."cities"
(
    "id"         integer DEFAULT nextval('cities_id_seq') NOT NULL,
    "name"       character varying(255)                   NOT NULL,
    "country_id" integer                                  NOT NULL,
    CONSTRAINT "cities_pkey" PRIMARY KEY ("id"),
    CONSTRAINT "unique_city" UNIQUE ("name", "country_id")
) WITH (oids = false);

CREATE
    INDEX "city_name_index" ON "public"."cities" USING btree ("name");

DROP TABLE IF EXISTS "countries";
DROP SEQUENCE IF EXISTS countries_id_seq;
CREATE SEQUENCE countries_id_seq INCREMENT 1 MINVALUE 1 MAXVALUE 2147483647 CACHE 1;

CREATE TABLE "public"."countries"
(
    "id"   integer DEFAULT nextval('countries_id_seq') NOT NULL,
    "code" character varying(4)                        NOT NULL,
    "name" character varying(255)                      NOT NULL,
    CONSTRAINT "countries_pkey" PRIMARY KEY ("id"),
    CONSTRAINT "uk_1pyiwrqimi3hnl3vtgsypj5r" UNIQUE ("name"),
    CONSTRAINT "uk_5dhgnik9p8t72kaktdb8kd8dt" UNIQUE ("code")
) WITH (oids = false);

CREATE
    INDEX "country_name_index" ON "public"."countries" USING btree ("name");

DROP TABLE IF EXISTS "employees";
CREATE TABLE "public"."employees"
(
    "id"         uuid                   NOT NULL,
    "create_at"  timestamp              NOT NULL,
    "phone"      character varying(255) NOT NULL,
    "update_at"  timestamp              NOT NULL,
    "aircrew_id" uuid,
    "user_id"    uuid,
    CONSTRAINT "employees_pkey" PRIMARY KEY ("id"),
    CONSTRAINT "uk_gnponadwwxr5nm2tqe5b905hs" UNIQUE ("phone")
) WITH (oids = false);

DROP TABLE IF EXISTS "flights";
CREATE TABLE "public"."flights"
(
    "id"             uuid                   NOT NULL,
    "create_at"      timestamp              NOT NULL,
    "departure_time" timestamp              NOT NULL,
    "number"         character varying(255) NOT NULL,
    "update_at"      timestamp              NOT NULL,
    "aircrew_id"     uuid                   NOT NULL,
    "airplane_id"    uuid                   NOT NULL,
    "route_id"       uuid                   NOT NULL,
    CONSTRAINT "flights_pkey" PRIMARY KEY ("id"),
    CONSTRAINT "uk_fmnh2do5nscsnurc25phrj2np" UNIQUE ("number")
) WITH (oids = false);

DROP TABLE IF EXISTS "passengers";
CREATE TABLE "public"."passengers"
(
    "id"        uuid      NOT NULL,
    "create_at" timestamp NOT NULL,
    "update_at" timestamp NOT NULL,
    "user_id"   uuid,
    CONSTRAINT "passengers_pkey" PRIMARY KEY ("id")
) WITH (oids = false);

DROP TABLE IF EXISTS "passports";
CREATE TABLE "public"."passports"
(
    "id"        uuid      NOT NULL,
    "code"      integer   NOT NULL,
    "create_at" timestamp NOT NULL,
    "date"      timestamp NOT NULL,
    "number"    integer   NOT NULL,
    "series"    integer   NOT NULL,
    "update_at" timestamp NOT NULL,
    CONSTRAINT "passports_pkey" PRIMARY KEY ("id")
) WITH (oids = false);

DROP TABLE IF EXISTS "roles";
DROP SEQUENCE IF EXISTS roles_id_seq;
CREATE SEQUENCE roles_id_seq INCREMENT 1 MINVALUE 1 MAXVALUE 2147483647 CACHE 1;

CREATE TABLE "public"."roles"
(
    "id"        integer DEFAULT nextval('roles_id_seq') NOT NULL,
    "create_at" timestamp                               NOT NULL,
    "name"      character varying(255)                  NOT NULL,
    "user_id"   uuid                                    NOT NULL,
    CONSTRAINT "roles_pkey" PRIMARY KEY ("id"),
    CONSTRAINT "uk_ofx66keruapi6vyqpv6f2or37" UNIQUE ("name")
) WITH (oids = false);

DROP TABLE IF EXISTS "routers";
CREATE TABLE "public"."routers"
(
    "id"              uuid NOT NULL,
    "from_airport_id" uuid NOT NULL,
    "to_airport_id"   uuid NOT NULL,
    CONSTRAINT "routers_pkey" PRIMARY KEY ("id")
) WITH (oids = false);

DROP TABLE IF EXISTS "tikets";
CREATE TABLE "public"."tikets"
(
    "id"           uuid                 NOT NULL,
    "create_at"    timestamp            NOT NULL,
    "has_bag"      boolean              NOT NULL,
    "seat"         character varying(4) NOT NULL,
    "flight_id"    uuid                 NOT NULL,
    "passenger_id" uuid                 NOT NULL,
    CONSTRAINT "tikets_pkey" PRIMARY KEY ("id"),
    CONSTRAINT "uk_hkhq2a728v2tx3qis67r7s6dh" UNIQUE ("seat")
) WITH (oids = false);

DROP TABLE IF EXISTS "users";
CREATE TABLE "public"."users"
(
    "id"          uuid                   NOT NULL,
    "create_at"   timestamp              NOT NULL,
    "email"       character varying(255) NOT NULL,
    "first_name"  character varying(255) NOT NULL,
    "last_name"   character varying(255) NOT NULL,
    "password"    character varying(128) NOT NULL,
    "second_name" character varying(255),
    "update_at"   timestamp              NOT NULL,
    "username"    character varying(32)  NOT NULL,
    "passport_id" uuid,
    CONSTRAINT "uk_6dotkott2kjsp8vw4d0m25fb7" UNIQUE ("email"),
    CONSTRAINT "uk_r43af9ap4edm43mmtq01oddj6" UNIQUE ("username"),
    CONSTRAINT "users_pkey" PRIMARY KEY ("id")
) WITH (oids = false);

CREATE
    INDEX "username_index" ON "public"."users" USING btree ("username");

